import { Input } from "antd";
import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  .inputWrapper {
    position: relative;
    margin-top: 32px;
  }
  .type {
    position: absolute;
    z-index: 99;
    top: -8px;
    left: 24px;
    height: 24px;
    background-color: #1890ff;
    padding: 0 24px;
    font-size: 16px;
    color: #fff;
    border-radius: 20px;
  }
  .inputType {
    width: 315px;
    height: 60px;
    border-radius: 20px;
    font-size: 20px;
  }
`;

export default function InputText(subtext) {
  return (
    <Wrapper>
      <div className="inputWrapper">
        <div className="type">Gửi đến ví</div>
        <Input className="inputType" placeholder="Nhập địa chỉ ví muốn gửi" />
      </div>
    </Wrapper>
  );
}
